import { Typography } from "@mui/material";
import React from "react";
import { useStyles } from "./style";



const GetStarted = (props)=>{
  const s = useStyles()
  return(
      <div className={s.getStarted}>
        <div className={s.inputDiv}><input placeholder='Enter email to sign up'/></div>
        <div className={s.buttonDiv}><button>Get Started</button></div>
        <Typography>No credit card required to sign up. Get 3 months free, then just $4.95 per month.</Typography>
      </div>

  )
}

export default GetStarted
